How Sweet It Is!

Steve Drake feels like he's gotten himself between a rock and a hard place! On one hand, things couldn't be better- he's become a big porno star since he moved to California. But on the other, his beautiful girlfriend Becky wants him to retire from the jizz-biz and settle down. Decisions, decisions! before he makes up his mind, Steve goes out with a bang...literally!

There's a sweet hitchhiker who takes a ride on Steven's &quot;mean machine,&quot; an insatiable black actress (Angel Kelly), and don't forget sizzling Becky. Plus, there's lots, lots more action! It's a frantic frolic that proves, when you're in a tight spot...it always leads to a Sticky Situation!
